	// below code causes the buttons to appear on ajax updated content (almost everything on fb)
	// written by http://stackoverflow.com/users/331508/brock-adams
	////////////////////////////////////////////////////////////////////////////////////
	/*--- waitForKeyElements():  A handy, utility function that	does what it says. ---*/
	function waitForKeyElements (
		selectorTxt,    // Required: The jQuery selector string that specifies the desired element(s).
		actionFunction, // Required: The code to run when elements are found. It is passed a jNode to the matched element.
		bWaitOnce,      // Optional: If false, will continue to scan for new elements even after the first match is found.
		iframeSelector  // Optional: If set, identifies the iframe to search.
	){
		var targetNodes, btargetsFound;
		if (typeof iframeSelector == "undefined")	targetNodes     = $JQ$(selectorTxt);
		else										targetNodes     = $JQ$(iframeSelector).contents().find(selectorTxt);
		if (targetNodes  &&  targetNodes.length > 0) {
			//--- Found target node(s).  Go through each and act if they are new.
			targetNodes.each ( function () {
				var jThis        = $JQ$(this);
				var alreadyFound = jThis.data ('alreadyFound')  ||  false;
				if (!alreadyFound) {
					//--- Call the payload function.
					actionFunction (jThis);
					jThis.data ('alreadyFound', true);
				}
			} );
			btargetsFound   = true;
		}
		else {
			btargetsFound   = false;
		}
		//--- Get the timer-control variable for this selector.
		var controlObj      = waitForKeyElements.controlObj  ||  {};
		var controlKey      = selectorTxt.replace (/[^\w]/g, "_");
		var timeControl     = controlObj [controlKey];
		//--- Now set or clear the timer as appropriate.
		if (btargetsFound  &&  bWaitOnce  &&  timeControl) {
			//--- The only condition where we need to clear the timer.
			clearInterval (timeControl);
			console.debug("timer cleared");
			delete controlObj [controlKey]
		}
		else {
			//--- Set a timer, if needed.
			if ( ! timeControl) {
				timeControl = setInterval ( function(){waitForKeyElements( selectorTxt, actionFunction, bWaitOnce, iframeSelector );}, 2000	);
				controlObj [controlKey] = timeControl;
				console.debug("timer set");
			}
		}
		waitForKeyElements.controlObj   = controlObj;
	}
	waitForKeyElements ("a", highlightGoodComments); // run the function!!!
